import React from 'react';

function tipomercado (props){
    return (
        <div className="tipoMercado">
            <div className="datosTM">
                <img className='imagenTm' src={props.imgTm} alt="imagenTm" />
            </div>
            <h1>Verduleria</h1>
        </div>
    )
}

export default tipomercado;
